  t_and_c_content_1:
    'Oky es una manera de controlar y aprender acerca de su ciclo menstrual as√≠ como proporcionar informaci√≥n sobre su per√≠odo y la salud femenina. El servicio se proporciona de forma gratuita. \n \n Por favor no utilizar ‚ÄúOky‚Äù PARA anticonceptivo o con fines m√©dicos. EN caso de cualquier problema de salud individual consulte a un m√©dico profesional. \n \n',
  t_and_c_content_2:
    'Oky no pretende sustituir a las medidas anticonceptivas y / o consejo m√©dico: s√≥lo se dise√±√≥ para proporcionar informaci√≥n. Mediante el uso de Oky usted se compromete a utilizarlo para los fines previstos solamente y sobre todo no para la anticoncepci√≥n y / o con fines m√©dicos. \n \n',
  t_and_c_content_3:
    'Oky ofrece contenido informativo general sobre la salud femenina la menstruaci√≥n la fertilidad y temas relacionados. Recoge los datos que se ponen los usuarios relacionados con su ciclo menstrual la actividad f√≠sica la salud y los cuerpos. \n \noky procesa estos puntos de datos en correlaci√≥n con la informaci√≥n m√©dica sobre el ciclo menstrual (tales como la duraci√≥n del ciclo) y otra informaci√≥n de la salud femenina. \n \nEstos puntos de datos combinados permiten que la aplicaci√≥n haga asociaciones e identificar patrones entre los eventos relacionados con el ciclo menstrual y la salud femenina utilizando f√≥rmulas matem√°ticas / estad√≠sticas simples y c√°lculos basados ‚Äã‚Äãen el algoritmo. \n \n',
  t_and_c_content_4:
    'Para obtener informaci√≥n sobre los datos que recopilamos y utilizamos consulte nuestra pol√≠tica de privacidad. \n \n',
  t_and_c_content_5:
    'A pesar de que UNICEF realiza esfuerzos razonables para actualizar la informaci√≥n sobre Oky no hacemos ninguna representaci√≥n garant√≠a o garant√≠as ya sea expresa o impl√≠cita de que el contenido de Oky sea exacta completa o actualizada. \n \n',
  t_and_c_content_6:
    'UNICEF modifica estos t√©rminos de vez en cuando. Cada vez que desee utilizar Oky por favor revise estos t√©rminos para asegurarse de que entiende los t√©rminos que se aplican en ese momento. \n \n',
  t_and_c_content_7:
    'UNICEF puede actualizar y cambiar Oky de vez en cuando para proporcionar informaci√≥n actualizada enlaces o proporcionar nuevas funcionalidades y reflejar los cambios en nuestras necesidades users \n \n',
  t_and_c_content_8:
    'Oky est√° disponible de forma gratuita. UNICEF no garantiza que Oky o cualquier contenido en √©l siempre estar√° disponible o no se interrumpa. Podemos suspender o retirar o restringir la disponibilidad de la totalidad o parte de Oky por razones operativas o de otro tipo. Vamos a tratar de dar aviso razonable de cualquier suspensi√≥n o retirada. \n \n',
  t_and_c_content_9:
    'Si alguien usa Oky dem√°s a trav√©s de su dispositivo tambi√©n es responsable de asegurar que est√°n al tanto de estas condiciones de uso y dem√°s t√©rminos y condiciones aplicables y que cumplan con ellos. \n \n',
  t_and_c_content_10:
    'Si lo desea o se le proporciona un c√≥digo de identificaci√≥n de usuario contrase√±a o cualquier otra pieza de informaci√≥n como parte de los procedimientos de seguridad de UNICEF se debe tratar la informaci√≥n como confidencial. No debe revelarla a terceros. \n \n',
  t_and_c_content_11:
    'UNICEF tiene el derecho de desactivar cualquier c√≥digo de identificaci√≥n de usuario o contrase√±a ya sea elegido por usted o asignado por nosotros en cualquier momento si en nuestra opini√≥n razonable que haya dejado de cumplir con cualquiera de las disposiciones de estas condiciones de uso. \n \norte',
  t_and_c_content_12:
    'Mediante el uso de Oky usted est√° de acuerdo que la ubicaci√≥n que usted proporciona al registrarse es exacta. \n \n',
  t_and_c_content_13:
    'Oky puede vincular a otros sitios y recursos que no est√°n bajo el control de UNICEF. La inclusi√≥n de dichos enlaces no implica un respaldo o aprobaci√≥n por parte de UNICEF de cualquier sitio web producto o servicio. \n \n',
  t_and_c_content_14:
    'UNICEF no asume responsabilidad alguna respecto de dichos sitios web incluyendo por ejemplo responsabilidad alguna por la exactitud o confiabilidad de cualquier informaci√≥n datos opiniones consejos o declaraciones hechas en estos sitios web. \n',
  t_and_c_content_15: 'Todo en este sitio es para usted y sus compa√±eros no para uso comercial. \n',
  t_and_c_content_17:
    'No excluye ni limita en modo alguno nuestra responsabilidad hacia usted en la que ser√≠a ilegal hacerlo. Esto incluye la responsabilidad por muerte o lesiones personales causadas por nuestra negligencia o la negligencia de nuestros empleados agentes o subcontratistas y por fraude o tergiversaci√≥n fraudulenta. \n \n',
  t_and_c_content_18:
    'Tenga en cuenta que s√≥lo proporcionan Oky para su uso personal dom√©stico y privado. El usuario acepta no utilizar Oky para fines comerciales o de negocios y no tenemos ninguna responsabilidad hacia usted por cualquier p√©rdida de beneficios p√©rdida de negocio p√©rdida de beneficios o p√©rdida de la oportunidad de negocio. \n \n',
  t_and_c_content_19:
    'S√≥lo utilizaremos su informaci√≥n personal seg√∫n lo establecido en nuestra pol√≠tica de privacidad. \n \n',
  t_and_c_content_20:
    'Estas condiciones de uso su materia y su formaci√≥n se rigen por la ley estadounidense. Los tribunales de los EE.UU. tendr√°n jurisdicci√≥n exclusiva. \n \n',
  t_and_c_content_21:
    'El nombre y el emblema de UNICEF son propiedad exclusiva de UNICEF. Est√°n protegidos por el derecho internacional. El uso no autorizado est√° prohibido. Ellos no pueden ser copiados o reproducidos en cualquier forma sin el permiso previo por escrito de UNICEF. Si usted tiene alguna pregunta sobre este contacto favor de UNICEF.',
  privacy_heading_1: 'POL√çTICA DE PRIVACIDAD DE OKY \n \n',
